insert into products (title, description, price, image_url, created_at, updated_at) values ('En film', 'En spännande thriller som håller dig på kanten av din stol från början till slut. Filmen utforskar djupa mänskliga känslor och komplexa relationer.', 149, 'https://images.pexels.com/photos/5662857/pexels-photo-5662857.png?auto=compress&cs=tinysrgb&w=600', '2022-07-01 09:30:45', '2022-07-01 09:30:45');
insert into products (title, description, price, image_url, created_at, updated_at) values ('Johans bok', 'En fängslande roman som berättar historien om Johans resa genom livets upp- och nedgångar, med insiktsfulla observationer om kärlek, förlust och vad det innebär att vara människa.', 229, 'https://images.pexels.com/photos/4170629/pexels-photo-4170629.jpeg?auto=compress&cs=tinysrgb&w=600', '2022-07-15 11:42:37', '2022-07-15 11:42:37');
insert into products (title, description, price, image_url, created_at, updated_at) values ('Frysmaskin', 'En högeffektiv frysmaskin designad för både hemmabruk och kommersiellt bruk, med avancerad frysteknologi som säkerställer att dina livsmedel förblir fräscha längre.', 8999, 'https://images.pexels.com/photos/2343467/pexels-photo-2343467.jpeg?auto=compress&cs=tinysrgb&w=600', '2022-08-02 14:23:58', '2022-08-02 14:23:58');
insert into products (title, description, price, image_url, created_at, updated_at) values ('Datordel', 'Högkvalitativa datorkomponenter som är kompatibla med de flesta datorsystem. Perfekt för att uppgradera din dator eller bygga en helt ny från grunden.', 999, 'https://images.pexels.com/photos/4779887/pexels-photo-4779887.jpeg?auto=compress&cs=tinysrgb&w=600', '2022-08-20 16:04:19', '2022-08-20 16:04:19');
insert into products (title, description, price, image_url, created_at, updated_at) values ('Grafikkort', 'Det senaste inom grafikteknik, detta kraftfulla grafikkort levererar enastående prestanda för spel och professionellt arbete.', 5799, 'https://images.pexels.com/photos/6341789/pexels-photo-6341789.jpeg?auto=compress&cs=tinysrgb&w=600', '2022-09-05 18:55:30', '2022-09-05 18:55:30');
insert into products (title, description, price, image_url, created_at, updated_at) values ('Tangentbort', 'En elegant och responsiv tangentbord designad för både spel och arbete. Med RGB-belysning och ergonomisk design för maximal komfort.', 799, 'https://images.pexels.com/photos/585752/pexels-photo-585752.jpeg?auto=compress&cs=tinysrgb&w=600', '2022-09-22 20:46:42', '2022-09-22 20:46:42');
insert into products (title, description, price, image_url, created_at, updated_at) values ('Lampa', 'Dekorativ och energieffektiv LED-lampa som skapar en varm och välkomnande atmosfär i ditt hem. Perfekt för vardagsrum, sovrum eller kontor.', 459, 'https://images.pexels.com/photos/1112598/pexels-photo-1112598.jpeg?auto=compress&cs=tinysrgb&w=600', '2022-10-03 09:57:12', '2022-10-03 09:57:12');
insert into products (title, description, price, image_url, created_at, updated_at) values ('Penna', 'En exklusiv skrivpenna som kombinerar elegant design med exceptionell skrivkomfort. Idealisk för både professionellt bruk och för de speciella tillfällena.', 349, 'https://images.pexels.com/photos/159644/art-supplies-brushes-rulers-scissors-159644.jpeg?auto=compress&cs=tinysrgb&w=600', '2022-10-17 11:43:21', '2022-10-17 11:43:21');
insert into products (title, description, price, image_url, created_at, updated_at) values ('Gardiner', 'Stilfulla och praktiska gardiner som inte bara förbättrar rummets estetik utan också erbjuder utmärkt ljusreglering och integritet.', 999, 'https://images.pexels.com/photos/910458/pexels-photo-910458.jpeg?auto=compress&cs=tinysrgb&w=600', '2022-11-02 13:29:33', '2022-11-02 13:29:33');
insert into products (title, description, price, image_url, created_at, updated_at) values ('Blomma', 'En vacker och lättskött inomhusväxt som tillför en touch av grönska och friskhet till ditt hem. Perfekt för att liva upp vilket rum som helst.', 199, 'https://images.pexels.com/photos/1974508/pexels-photo-1974508.jpeg?auto=compress&cs=tinysrgb&w=600', '2022-11-18 15:15:45', '2022-11-18 15:15:45');
insert into products (title, description, price, image_url, created_at, updated_at) values ('Datorskärm','En toppmodern datorskärm som erbjuder kristallklar bildkvalitet och hög uppdateringsfrekvens för den ultimata visuella upplevelsen, vare sig du arbetar eller spelar.', 2499, 'https://images.pexels.com/photos/1779487/pexels-photo-1779487.jpeg?auto=compress&cs=tinysrgb&w=600', '2022-12-05 17:01:57', '2022-12-05 17:01:57');
